import React, { useEffect } from "react";
import { Link, useLocation } from "react-router-dom";
import { useAuth0 } from "@auth0/auth0-react";
import { motion } from "framer-motion";
import Services from "./Services";
import Tips from "./Tips";

function Homepage() {
  const { loginWithRedirect, logout, isAuthenticated } = useAuth0();
  const location = useLocation();

  useEffect(() => {
    window.scrollTo(0, 0);
  }, []);

  return (
    <div className="font-sans text-gray-900">
      {/* Hero */}
      <section
        className="relative min-h-screen bg-cover bg-center flex items-center justify-center"
        style={{ backgroundImage: 'url("/hero-image2.jpg")' }}
      >
        <div className="absolute inset-0 bg-black/50 backdrop-blur-sm" />
        <motion.div
          initial={{ opacity: 0, y: 40 }}
          animate={{ opacity: 1, y: 0 }}
          transition={{ duration: 0.8 }}
          className="relative z-10 max-w-3xl text-center text-white px-6"
        >
          <h1 className="text-5xl md:text-6xl font-extrabold bg-gradient-to-r from-indigo-400 to-pink-500 bg-clip-text text-transparent drop-shadow-lg">
            Bring Your Business Online
          </h1>
          <p className="mt-4 text-lg md:text-xl text-gray-200">
            Unlock new opportunities and reach a broader audience with{" "}
            <span className="font-semibold">Solicio</span>.
          </p>

          {/* Buttons */}
          <div className="mt-8 flex flex-wrap gap-4 justify-center">
            {isAuthenticated ? (
              <button
                onClick={() =>
                  logout({ logoutParams: { returnTo: window.location.origin } })
                }
                className="px-6 py-3 rounded-full bg-gradient-to-r from-indigo-500 to-pink-500 shadow-lg hover:scale-105 hover:shadow-xl transition-all duration-300"
              >
                Logout
              </button>
            ) : (
              <button
                onClick={() =>
                  loginWithRedirect({ appState: { returnTo: location.pathname } })
                }
                className="px-6 py-3 rounded-full bg-gradient-to-r from-indigo-500 to-pink-500 shadow-lg hover:scale-105 hover:shadow-xl transition-all duration-300"
              >
                Sign Up
              </button>
            )}
            <Link
              to="/contact"
              className="px-6 py-3 rounded-full bg-white/90 text-gray-900 font-medium shadow-lg hover:scale-105 hover:shadow-xl transition-all duration-300"
            >
              Learn More
            </Link>
          </div>
        </motion.div>
      </section>

      {/* Divider */}
      <svg
        className="w-full text-gray-50"
        viewBox="0 0 1440 80"
        fill="currentColor"
        preserveAspectRatio="none"
      >
        <path d="M0,32L1440,0L1440,80L0,80Z" />
      </svg>

      {/* Tagline */}
      <motion.div
        initial={{ opacity: 0, y: 20 }}
        whileInView={{ opacity: 1, y: 0 }}
        viewport={{ once: true }}
        transition={{ duration: 0.8 }}
        className="py-16 text-center bg-gray-50"
      >
        <h2 className="text-3xl md:text-4xl font-bold tracking-wide text-gray-800">
          छोटे कदम, बड़ी उड़ान
        </h2>
        <img
          src="https://gorgeous-gumption-a148f7.netlify.app/pakshi.jpeg"
          alt="Tagline"
          className="mt-6 w-56 rounded-xl shadow-lg hover:scale-105 transition-transform duration-500 mx-auto"
        />
        <p className="mt-4 text-gray-600 italic">
          (Chhote Kadam, Badi Udaan) - Small Steps, Big Flight
        </p>
      </motion.div>

      {/* Success Stories */}
      <section className="py-20 bg-gradient-to-br from-gray-50 to-gray-100">
        <h3 className="text-4xl font-bold text-center mb-12 text-gray-800">
          Success Stories
        </h3>
        <div className="grid grid-cols-1 md:grid-cols-3 gap-10 px-6 max-w-6xl mx-auto">
          {[
            {
              name: "Maria Lopez",
              text: "Thanks to MSME Connect, my business has grown exponentially!",
              image: "/story1.jpg",
            },
            {
              name: "Gurpeerat Singh",
              text: "Our reach has expanded far beyond our expectations.",
              image: "/story2.jpg",
            },
            {
              name: "Ahmed Khan",
              text: "MSME Connect made digital transformation seamless.",
              image: "/story3.jpg",
            },
          ].map((story, idx) => (
            <motion.div
              key={idx}
              whileHover={{ scale: 1.05, y: -4 }}
              transition={{ type: "spring", stiffness: 200 }}
              className="bg-white rounded-2xl shadow-lg hover:shadow-2xl transition-all duration-500 overflow-hidden"
            >
              <img
                src={story.image}
                alt={story.name}
                className="w-full h-56 object-cover"
              />
              <div className="p-6">
                <p className="mb-3 text-gray-600 italic">"{story.text}"</p>
                <p className="font-semibold text-lg text-gray-800">{story.name}</p>
              </div>
            </motion.div>
          ))}
        </div>
      </section>

      {/* Keep your How it works / Metrics / Services / Tips sections 
          but add motion + gradient backgrounds similarly */}
      <Services />
      <Tips />
    </div>
  );
}

export default Homepage;
